css:
.badge {
  margin-left: 10px;
}
.component-search-container {
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}
.component-search-in-pane-text {
  align-items: center;
  background: #21252b;
  color: rgba(157, 165, 180, 0.6);
  display: flex;
  flex-grow: 1;
  font-weight: bold;
  justify-content: center;
  padding: 1em;
  text-align: center;
  white-space: normal;
}
.component-search-controls {
  background: #282c34;
  border-bottom: 1px solid #181a1f;
  flex-shrink: 0;
  padding: 10px 0 0 10px;
  width: 100%;
}
.component-search-controls-row {
  align-items: center;
  display: flex;
  flex-flow: row wrap;
  /* The full-width block fills the space. */
}
.component-search-controls-row .component-search-controls-block-full-width {
  flex: 1;
}
.component-search-controls-block {
  align-items: center;
  display: flex;
  margin: 0 10px 10px 0;
}
.component-search-controls-block .full-width {
  max-width: none;
  width: 100%;
}
.component-search-controls-label,
.component-search-controls-modifiers {
  margin-right: 10px;
  margin-left: 10px;
  text-align: right;
  min-width: 7em;
}
.component-search-controls-input-narrow {
  width: 5em;
}
.component-search-controls-input-medium {
  width: 20em;
}
.component-search-controls-regex-button {
  font-family: Menlo, monospace;
}
.component-search-controls-projects-dropdown {
  max-width: 24em;
}
.component-search-search-results-wrapper {
  display: flex;
  flex-direction: column;
}
.component-search-search-results {
  background: #21252b;
  padding: 10px;
  flex-grow: 1;
}
.component-search-search-results-controls {
  background: #282c34;
  position: relative;
}
.component-search-search-results-controls-form {
  display: flex;
  flex-wrap: wrap;
  flex-shrink: 0;
  justify-content: space-between;
  padding: 10px 0 0 10px;
}
.component-search-search-results-controls-button {
  margin-left: 10px;
}
.component-search-search-results-controls-toggle {
  margin: 0 10px 10px 0;
}
.component-search-search-results-controls-toggle-hidden {
  border-top: none;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
  position: absolute;
  right: 10px;
}
.component-search-search-results-filename {
  cursor: pointer;
  display: inline-block;
  margin-bottom: 5px;
  overflow-x: auto;
  white-space: nowrap;
}
.component-search-search-results-filename:hover {
  color: #d7dae0;
}
.component-search-search-results-filename .icon {
  text-align: center;
  vertical-align: middle;
}
.component-search-search-results-snippet {
  border-radius: 3px;
  border: 1px solid #181a1f;
  display: flex;
  margin-bottom: 10px;
}
.component-search-search-results-line-numbers,
.component-search-search-results-code {
  display: inline-block;
  font-family: Menlo, Monaco, Consolas, monospace;
  line-height: 25px;
  white-space: pre;
}
.component-search-search-results-line-numbers {
  background: #282c34;
  color: #636d83;
  cursor: pointer;
  min-width: 3em;
  padding: 0 0.5em;
  text-align: right;
  -webkit-user-select: none;
}
.component-search-search-results-line-numbers > div:hover {
  color: #abb2bf;
}
.component-search-search-results-code {
  background: #282c34;
  flex: 1;
  padding-left: 0.5em;
  overflow-x: auto;
}
.component-search-search-results-code .nuclide-match-highlighted-text-match {
  /* Copied from .highlight-info class style */
  padding: 1px 4px;
  border-radius: 2px;
  font-weight: 500;
  text-shadow: 0 1px 0px rgba(0, 0, 0, 0.2);
  background-color: #0f82e6;
  box-shadow: inset 0 0 1px #f5fafe;
  color: white;
  cursor: pointer;
}
.component-search-search-results-code .nuclide-match-highlighted-text-match:hover {
  text-decoration: underline;
}
.component-search-prop-usage-summary {
  border-radius: 3px;
  border: 1px solid #181a1f;
  display: flex;
  flex-direction: column;
  margin-bottom: 10px;
}
.component-search-prop-value-usage {
  background: #282c34;
  flex: 1;
  padding: 10px 0 10px 0;
  overflow-x: auto;
  cursor: pointer;
}
.component-search-prop-value-usage:hover {
  color: #d7dae0;
}
.component-search-inline-graphic {
  margin-left: 10px;
  margin-right: 10px;
}
